int tile_set_center(int tile, int flags)
{
    if (!TILE_IS_VALID(tile)) {
        return -1;
    }

    if ((flags & TILE_SET_CENTER_FLAG_IGNORE_SCROLL_RESTRICTIONS) == 0) {
        if (scroll_limiting_on) {
