            int dx = abs(dudeScreenX - tileScreenX);
            int dy = abs(dudeScreenY - tileScreenY);

            if (dx > abs(dudeScreenX - tile_offx)
                || dy > abs(dudeScreenY - tile_offy)) {
                if (dx >= 480 || dy >= 400) {
                    return -1;
                }
            }
        }

        if (scroll_blocking_on) {
            if (obj_scroll_blocking_at(tile, map_elevation) == 0) {
                return -1;
            }
        }
    }

